import React, { useState } from "react";
import styled, { css } from "styled-components";
import NavbarMain from "../../Common/atoms/NavbarMain";
import NavbarMenu from "../../Common/molecules/MenuList";
/* 상단 고정 네이게이션 바 Template*/
const NavbarTemplate = styled.div`
  position: fixed;
  top: 0px;
  width: 100%;
  height: 120px;
  box-sizing: border-box;
  display: flex;
  align-items: center;
  background: #fff;
  padding-left: 70px;
  padding-right: 70px;
  z-index: 3;
`;

function MainNavbar() {
  return (
    <NavbarTemplate>
      <NavbarMain />
      <NavbarMenu />
    </NavbarTemplate>
  );
}

export default MainNavbar;
